import React from "react";

const LibrarySongs = ({ song }) => {
  return (
    <div className="card">
      <h3>{song.name}</h3>
      <p>Artist</p>
      <p>Type</p>
      <h4>Image</h4>
    </div>
  );
};

export default LibrarySongs;
